import React from 'react';
import s from './Button.module.css';

type ButtonType = {
name:string;
started:()=>void
}


export const Button = (props:ButtonType) => {
    const Started = ()=>{
        props.started()
    }
    return (

   <button className={props.name='All|Active|Completed' ? s.activeBottom:''} onClick={Started}>{props.name}</button>

    );
};
